import React from "react";
import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navbar";
import Counters from "./components/counters";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  state = {
    counters: [
      { id: 1, value: 4},
      { id: 1, value: 4},
      { id: 1, value: 4},
      { id: 1, value: 4},
    ]
  };

  return (
    <React.Fragment>
      <NavBar />
      <Counters />
    </React.Fragment>
  );
}

export default App;
